import styles from "./SeeMore.module.scss";
import { useState } from "react";
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
  faA,
  faQuestionCircle,
  faKeyboard,
} from "@fortawesome/free-solid-svg-icons";
import Menu from "../Menu";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

function SeeMore() {
  const [listSeeMore] = useState([
    {
      text: "English",
      iconSeeMore: <FontAwesomeIcon className={styles["icon"]} icon={faA} />,
      children: [{ language: "English" }],
    },
    { text: "Feedback and help", iconSeeMore: faQuestionCircle },
    { text: "Keyboard shortcuts", iconSeeMore: faKeyboard },
  ]);

  const renderList = () => {
    return listSeeMore.map((seeMore, index) => {
      return (
        <Menu
          key={index}
          text={seeMore.text}
          icon={seeMore.iconSeeMore}
        ></Menu>
      );
    });
  };

  return <div className={styles["row-menu"]}>{renderList()}</div>;
}

export default SeeMore;
